class Solution {
public:
    int countWithMergeSort(vector<long> &sums, int left, int right, int lower, int upper)
    {
        if (left >= right) return 0; // Return immediately for invalid range

        int mid = left + (right - left) / 2;
        int count = 0;

        // Recursively sort and count in two halves
        count += countWithMergeSort(sums, left, mid, lower, upper);
        count += countWithMergeSort(sums, mid + 1, right, lower, upper);

        int i = left;
        int j = mid + 1;
        int k = 0;
        vector<long> cache(right - left + 1, 0); // Create a temporary array to hold sorted results

        while (i <= mid && j <= right) {
            if (sums[j] - sums[i] > upper) ++j;
            else if (sums[j] - sums[i] < lower) --i,++j;
            else count += j - mid , ++j;
        }

        i = left;
        j = mid + 1;

        while (i <= mid && j <= right) { // Merge two halves
            if (sums[i] <= sums[j]) cache[k++] = sums[i++];
            else cache[k++] = sums[j++];
        }

        while (i <= mid) cache[k++] = sums[i++]; // Copy remaining elements
        while (j <= right) cache[k++] = sums[j++];

        for (int idx = 0; idx < cache.size(); ++idx) 
            sums[left + idx] = cache[idx]; // Update original array with sorted results

        return count;
    }

    int countRangeSum(vector<int>& nums, int lower, int upper) {

        vector<long> prefixSums(nums.size() + 1, 0);
        for (int i = 0; i < nums.size(); ++i) 
            prefixSums[i+1] = prefixSums[i] + nums[i]; // Calculate prefix sums

        return countWithMergeSort(prefixSums, 0, nums.size(), lower, upper);
    }
};

