# Intuition
The main idea of this problem is to generate all non empty partitions of a string using Backtracking.

For example let's  say i = 36, it's square = 36*36 = 1296
To check if some partition of 1296 satisfy given statement, we make all partitions e.g
[1,2,9,6], [1,29,6], [1,296], [12,9,6] , [12,96], [129,6]

Among these only [1,29,6] satisfies the constraint.

We only need one of these set to satisfy the statement, hence we break immediately if we find any valid set.
<!-- Describe your first thoughts on how to solve this problem. -->

# Approach
* Generate all possible squares and check if they satisfy the given statement
* To check if a square satisfies the given constraint or not generate all possible partitions using backtracking.
* If any single partition satisfy the statement then this square will be added to solution
<!-- Describe your approach to solving the problem. -->

