# Intuition
To solve this problem, we can use a dynamic programming approach. 

# Approach
The idea is to maintain two variables, buy and sell, which represent the maximum profit you can achieve if you have bought or sold the stock, respectively. Initially, buy is set to the negative of the first price, assuming we buy the stock on the first day. sell is set to zero because we haven't sold any stock yet.

Then, for each day starting from the second day, we update buy and sell as follows:

- Update buy by taking the maximum value between the previous buy and the difference between sell and the current price (representing the profit we would make if we bought the stock on this day).
- Update sell by taking the maximum value between the previous sell and the sum of the previous buy and the current price minus the transaction fee (representing the profit we would make if we sold the stock on this day).

Finally, the maximum profit we can achieve is stored in the sell variable, so we return its value.

# Complexity
- Time complexity:
O(n)

- Space complexity:
O(1)

