        int n = mat.size();
        int m = mat[0].size();
        vector<vector<int>> dp(n, vector<int>(m, INT_MAX - 2));

        // First pass: check for top and left neighbors
        for (int i = 0; i < n; ++i) {
            for (int j = 0; j < m; ++j) {
                if (mat[i][j] == 0) dp[i][j] = 0;  // If cell value is 0, distance is also 0.
                else {
                    // Check the top neighbor
                    if (i > 0) dp[i][j] = min(dp[i][j], dp[i-1][j] + 1);
                    // Check the left neighbor
                    if (j > 0) dp[i][j] = min(dp[i][j], dp[i][j-1] + 1);
                }
            }
        }

        // Second pass: check for bottom and right neighbors
        for (int i = n - 1; i >= 0; --i) {
            for (int j = m - 1; j >= 0; --j) {
                if (mat[i][j] != 0){
                    // Check the bottom neighbor
                    if (i < n - 1) dp[i][j] = min(dp[i][j], dp[i+1][j] + 1);
                    // Check the right neighbor
                    if (j < m - 1) dp[i][j] = min(dp[i][j], dp[i][j+1] + 1);
                }
            }
        }

