# Intuition
<!-- Describe your first thoughts on how to solve this problem. -->
We have to update the grid according to the following rules : 
1. Any live cell with fewer than two live neighbors dies as if caused by under-population.
2. Any live cell with two or three live neighbors lives on to the next generation.
3. Any live cell with more than three live neighbors dies, as if by over-population.
4. Any dead cell with exactly three live neighbors becomes a live cell, as if by reproduction.


---


# Approach 1 : Using extra space for copying the board
<!-- Describe your approach to solving the problem. -->
- In this approach, we will make a copy of original board and then modify the original board by counting the live neighbours from the copy board.

---
# Code
```
class Solution {
public:
    void gameOfLife(vector<vector<int>>& board) {

        int rows = board.size();
        int cols = board[0].size();

        //copying the board to 2-D vector copy
        vector<vector<int>> copy(board);

        for(int i=0; i<rows; i++)
        {
            for(int j=0; j<cols; j++)
            {
                //for counting live neighbors of the element
                int liveNeighbors = 0; 

                //iterating through all the neighbors of the element (inside the board and outside the board)
                for(int m=i-1; m<i+2; m++)
                {
                    for(int n=j-1; n<j+2; n++)
                    {
                        //we will skip the iteration when element itself is encountered
                        if(m==i && n==j)
                            continue;

                        //checking the bounds, if indices are in range, we will check for liveNeighbors
                        if(m>=0 && m<rows && n>=0 && n<cols && copy[m][n] == 1)
                            liveNeighbors++;
                    }
                }

                //for live cells, if liveNeighbors are less than 2 or more than 3, cells will die and dead cells are already dead, so we need not check cell to be live or dead
                if(liveNeighbors < 2 || liveNeighbors > 3)
                    board[i][j] = 0;

                //for dead cells, if liveNeighbors are exactly 3, it will live and live cell will also live for exactly 3 liveNeighbors
                else if(liveNeighbors == 3)
                    board[i][j] = 1;

                //For live cells, if liveNeighbors are exactly 2, it will live but we need not update it as it is already live

            }
        }
    }
};
```
---
# Complexity
- Time complexity: $$O(m*n)$$
<!-- Add your time complexity here, e.g. $$O(n)$$ -->

- Space complexity: $$O(m*n)$$
We are using extra space for copying the board.
<!-- Add your space complexity here, e.g. $$O(n)$$ -->

---

# Approach 2 : Using no extra space
<!-- Describe your approach to solving the problem. -->
- In this approach, we will use two extra digits i.e. 2 and 3 for in-place modifications.
- Digits will be as follows : 
`0 - Dead cell which will remain dead in next state`
`1 - Live cell which will die in next state`
`2 - Dead cell which will live in next state`
`3 - Live cell which will live in next state`


So the approach is that we will iterate through each cell of the board and count the live Neighbors. On the basis of the conditions given in the question, we will modify the board accordingly.
- For live cells, if liveNeighbors are exactly 2 or 3, they will live in next state, so we will change them to 3 by adding 2 to its value . If liveNeighbors are less than 2 or more than 3, they will die in next state so we will leave it as 1.
-`It can be observed that even after modifying the value of live cell to 3, we can still know about the its current state by using board[i][j] mod 2 as 3%2=1.`

- For dead cells, if liveNeighbors are exactly 3, they will live so we will update them to 2 by adding 2 to it. Otherwise they will remain dead in next state for rest of the cases, so we will not change it.
-`It can be observed that even after modifying the value of dead cell to 2, we can still know about the its current state by using board[i][j] mod 2 as 2%2=0.`

So we will use board[i][j] % 2 for checking its current state.

Now we will iterate through the board and for all cells with values 0 or 1, we will set it to 0 and for values 2 and 3, we will set it to 1.

---
# Code
```
class Solution {
public:
    void gameOfLife(vector<vector<int>>& board) {

        int rows = board.size();
        int cols = board[0].size();


        for(int i=0; i<rows; i++)
        {
            for(int j=0; j<cols; j++)
            {
                //for counting live neighbors of the element
                int liveNeighbors = 0;

                 //iterating through all the neighbors of the element (inside the board and outside the board)
                for(int m=i-1; m<i+2; m++)
                {
                    for(int n=j-1; n<j+2; n++)
                    {
                        //we will skip the iteration when element itself is encountered
                        if(m==i && n==j)
                            continue;

                        //checking the bounds, if indices are in range, we will check for liveNeighbors
                        if(m>=0 && m<rows && n>=0 && n<cols && board[m][n]%2 == 1)
                            liveNeighbors++;
                    }
                }

                //for live cells, doing the modifications
                if(board[i][j]%2 == 1)
                {
                    if(liveNeighbors == 2 || liveNeighbors == 3)
                        board[i][j] += 2;
                }
                //for dead cells, doing the modifications
                else
                {
                    if(liveNeighbors == 3)
                        board[i][j] += 2;
                }
            }
        }

        //iterating through the board and setting the values accordingly
        for(int i=0; i<rows; i++)
        {
            for(int j=0; j<cols; j++)
            {
                if(board[i][j] >= 2)
                    board[i][j] = 1;

                else
                    board[i][j] = 0;
            }
        }
    }
};
```
