# Intuition
We can use sliding window + Vector.

# Approach

We will initialize a vector end of size word with -1.Than we know the forbidden[i].size() is <= 10, so we can find all the index of the forbidden[i] in word string. we just need to find the ending points of each forbidden[i] in the word string and store it in ends vector with value of the starting index.

Now we will use Sliding Window.
- we check for each right pointer j in our vector that is, is it a end point? if yes than we need to find the starting point of the substring and let it be "st" using our vector of end points. than we check if st < i (our left pointer) if yes than it means our window is safe because it doesnt contain starting index of the particular forbidden word ending at j.

if st >= i(our left pointer) that means the starting point of forbidden word ending with right pointer j is in our window so we have to remove it by movig left pointer i = st+1.

if our right pointer j is not a end point than the window is valid and we can store the ans of it.

# Complexity
- Time complexity:
- O(N)

- Space complexity:
- O(N)

