        if (h) {
            if (hmemo[r][c] > 0) {
                return hmemo[r][c];
            }
            hmemo[r][c] = INT_MAX-1;
            if (c+2 < n && grid[r][c+2] == 0) {
                // move right
                res = min(res, 1+dfs(true, r, c+1));
            }
            if (r+1 < n && grid[r+1][c] == 0 && grid[r+1][c+1] == 0) {
                // move down
                res = min(res, 1+dfs(true, r+1, c));
                // rotate clockwise
                res = min(res, 1+dfs(false, r, c));
            }
            hmemo[r][c] = res;
            return res;
        } else {
            if (vmemo[r][c] > 0) {
                return vmemo[r][c];
            }
            vmemo[r][c] = INT_MAX-1;
            if (r+2 < n && grid[r+2][c] == 0) {
