# Intuition
<!-- Describe your first thoughts on how to solve this problem. -->
It's *generally* better to use BFS for search problems like this. However, given the constraints for this problem, DFS+memo is more than adequate; in fact it is both simpler and faster.

# Approach
<!-- Describe your approach to solving the problem. -->
DFS with two 2D arrays for memoization: `hmemo` for when we're horizontal, and `vmemo` for when we're vertical. While we're running DFS on a point, we can set its memo to `INT_MAX-1` so the code will short-circuit if we attempt anything that could cause a cycle. I also return `INT_MAX-1` if the target is unreachable. (`INT_MAX-1` avoids overflow when doing `1+dfs(...)`).

