public:
   int SolveByMemo(string &s, int &k, int index, int prev, vector<vector<int>> &dp) 
   {
       if (index == s.size()) return 1; // base case

       if (dp[index+1][prev] != -1) 
           return dp[index+1][prev];

       int res = 0;
       for (int i = index; i < s.size(); ++i) {
           if ((s[i]-'a') >= prev && k > 0) {
               res += SolveByMemo(s, k-1, i+1, s[i]-'a', dp);
           }
       } 

       return dp[index+1][prev] = res;
   }
};

