    vector<vector<int>>comb;

    // Function to find the number of rows a particular column combination can capture
    int find(vector<vector<int>>& mat1)
    {
        int c = 0;
        for(int i = 0; i < mat1.size(); i++)
        {
            int flg = 0;
            for(int j = 0; j < mat1[0].size(); j++)
                if(mat1[i][j] == 1)
                    flg = 1;
            if(flg == 0)
                c++;
        }
        return c;
    }

