        helper(mat, cols, count, idx+1, tans);
        tans.push_back(idx);
        helper(mat, cols, count+1, idx+1, tans);
    }

    int maximumRows(vector<vector<int>>& mat, int cols) {

        vector<int>tans;
        helper(mat, cols, 0, 0, tans);
        return find_ans(mat);
    }
};

