# Homework for you
Solve using catalan number and comment the code 
<!-- Describe your first thoughts on how to solve this problem. -->

# Approach
The main function numTrees(n) takes an integer n as input and returns the total number of unique binary search trees that can be formed with n nodes.

The helper function solve(n) takes an integer n (representing the number of nodes to form a binary search tree) and returns the number of unique binary search trees that can be formed with n nodes.

In the helper function solve, it initializes a vector dp of size n + 1 with all elements set to 0. The vector dp will be used to store the number of unique binary search trees for i nodes.

Initialize dp[0] and dp[1] to 1 since there is only one way to form binary search trees with 0 and 1 nodes (empty tree and single-node tree).

Iterate from i = 2 up to n. For each i, calculate the number of unique binary search trees using the Catalan number formula: dp[i] = dp[0] * dp[i - 1] + dp[1] * dp[i - 2] + ... + dp[i - 1] * dp[0]. This calculation is done by considering each element j as the root and multiplying the number of unique binary search trees for the left subtree (with j - 1 nodes) and the right subtree (with i - j nodes).

Return dp[n], which represents the total number of unique binary search trees with n nodes.
