class Solution {
public:
    int solve(int n, vector<int>& dp){
        if(dp[n] != -1) return dp[n];

        for(int i = 0; i < n; ++i) {
            dp[n] += solve(i, dp)*solve(n-i-1, dp);
        }

        return dp[n];
    }

    int numTrees(int n) {
        vector<int>dp(n+1,-1);
        dp[0] = dp[1] = 1;
        return solve(n, dp); 
    }
};

